import React from 'react';
import './footer.scss';
// import linkedIn from '../../assets/linkedin.svg';
// import github from '../../assets/github.svg';
// import email from '../../assets/email.svg';

const links = {
  'linkedIn': 'www.linkedin.com',
  'github': 'www.github.com',
  'email': 'mailto:contact@stephnathai.com'
};

function Links({links}) {
  // let imageLinks = Object.keys(links).map((link) => {
  //   return <a href={links[link]}><img class={link} src={require(`../../assets/${link}.svg`)} alt={link} /></a>
  // });

  let imageLinks = Object.keys(links).map( (name, index) => {
            return <img key={index} className="img-responsive" alt="" src={require(`./icons/${name}.png`)} />
        } );
  return(
    <div className='footer-links'>
      {imageLinks}
    </div>
  )
}

function Footer() {
  return(
    <Links links={links}></Links>
  )
}

export default Footer;
